INSERT INTO `adminnotification_inbox` VALUES (1,1,'2018-04-09 05:04:15','Take Steps to Protect Your Site ','Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks','https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks',0,0),(2,4,'2018-04-18 16:49:05','We want your opinion! Take our Digital Ad Tools survey.','We\'d like to invite you to take our online survey on digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/9QQLV67\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/9QQLV67',0,0),(3,1,'2018-04-12 06:00:00','Important WeltPixel Product Updates - April 2018','Since last month we made multiple product improvements, added new features and released new products, we hope you will find them useful! You can download the latest release from your weltpixel.com account. We would like to hear from you - leave a review or report a bug to any of our products. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',0,0),(4,4,'2018-05-02 21:07:10','Magento Open Source 2.2.4 Enables Better Shopping Experiences with Integrated Payment, Tax, and Shipping Solutions – 5/2/2018','The latest release of Magento Open Source empowers merchants to create better shopping experiences with performance enhancements and integrations with Amazon Pay, Klarna, and Vertex. Learn how these features can help you reduce cart abandonment and increase average order value, while simplifying your operations at https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce','https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce',0,0),(5,1,'2018-05-18 06:00:00','Important WeltPixel Product Updates - May 2018, compatibility with Magento 2.2.4','Since last month we made multiple product improvements and aligned compatibility of our products with latest Magento 2.2.4 Open Source and Commerce Cloud B2B. You can download the latest release from your weltpixel.com account. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',0,0),(6,4,'2018-06-12 17:06:10','We want your input! Please take our 10 question payments survey.','We\'d like to invite you to take our brief survey on payments. Your input is valuable to us and will help to inform our future products and services.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/LPV3WVX','https://www.surveymonkey.com/r/LPV3WVX',0,0),(7,1,'2018-06-27 18:45:34','Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',0,0),(8,4,'2018-07-10 20:14:32','We want your opinion! Take our brief Sales and Marketing survey.','We\'d like to invite you to take our short survey on sales channels and digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 3 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/ChannelSurvey2018\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/ChannelSurvey2018',0,0),(9,4,'2018-07-17 00:00:20','Survey: Help us improve the Admin Panel usability by taking this 5 minute survey.','We\'d like to invite you to take our online survey on Admin Panel Usability. Your input is valuable to us and will help to inform the user experience direction. The survey should take no more than 5 minutes to complete.\n \nTo get started, go to:\nhttps://www.surveymonkey.com/r/SUS-AdHoc-M2','https://www.surveymonkey.com/r/SUS-AdHoc-M2',0,0),(10,1,'2018-05-17 06:00:00','Important WeltPixel Product Updates - July 2018, compatibility with Magento 2.2.5','Since last month we made multiple product improvements and aligned compatibility of our products with latest Magento 2.2.5 Open Source and Commerce Cloud B2B. You can download the latest release from your weltpixel.com account. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',0,0);
