INSERT INTO `catalog_product_entity_text` VALUES (1,75,0,1,'<p>Sink into our luxurious, hotel quality, Super Microfibre bounce back pillows. Inspired by natural down, this pair of ultra-soft, fluffy pillows is almost cloud-like.</p>\r\n<p><strong>Hotel Quality Pillows</strong></p>\r\n<p>Developed as a hypoallergenic alternative to natural down, Super Microfibre is incredibly soft and fluffy with springy, ‘bounce back’ qualities. An equally luxurious alternative to down cushions, our synthetic <a href=\"https://www.homescapesonline.com/bedding/pillows/microfibre-pillows.html\">Microfibre pillows</a> offer five-star hotel quality and are loved around the world.</p>\r\n<p><strong>100% Microfibre Bounce Back Pillows</strong></p>\r\n<p>These machine washable pillows have an anti-dust mite, 100% microfibre casing so are ideal for those who suffer from allergies, asthma and sensitive skin. With a gentle fill level, these fluffy pillows can be used on top of firmer pillows for back or side sleepers or by themselves for front sleepers. Prolong the life of your pillows with our range of <a href=\"https://www.homescapesonline.com/bedding/mattress-protectors-toppers/pillow-protectors.html\">pillow protectors</a>.</p>'),(2,85,0,1,'Luxury Hotel Quality Super Microfibre Pillow Pair'),(6,85,0,3,'Cream Organic Cotton Fitted Sheet 400 TC'),(8,85,0,4,'Cream Organic Cotton Fitted Sheet 400 TC, Single'),(9,75,0,5,'<p>Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted Double Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.</p>\r\n<p><strong>400 Thread Count</strong></p>\r\n<p>With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat.</p>\r\n<p><strong>Cosy Cream</strong></p>\r\n<p>Measuring 137 x 190 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, king size and super king size, as well as 46 cm deep variations.</p>'),(10,76,0,5,'<p>Short Description</p>\r\n<p>Short DescriptionShort Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>'),(11,85,0,5,'Cream Organic Cotton Fitted Sheet 400 TC, Double'),(12,75,0,3,'<p>Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted King Size Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.</p>\r\n<p><strong>400 Thread Count</strong></p>\r\n<p>With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat.</p>\r\n<p><strong>Cosy Cream</strong></p>\r\n<p>Measuring 152 x 198 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, double and super king size, as well as 46 cm deep variations.</p>'),(13,75,0,6,'<p>&lt;p&gt;Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted King Size Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.&lt;/p&gt;<br />&lt;p&gt;&lt;strong&gt;400 Thread Count&lt;/strong&gt;&lt;/p&gt;<br />&lt;p&gt;With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat.&lt;/p&gt;<br />&lt;p&gt;&lt;strong&gt;Cosy Cream&lt;/strong&gt;&lt;/p&gt;<br />&lt;p&gt;Measuring 152 x 198 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, double and super king size, as well as 46 cm deep variations.&lt;/p&gt;</p>'),(14,76,0,6,'<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>'),(15,85,0,6,'Cream Organic Cotton Fitted Sheet 400 TC, King'),(16,75,0,7,'<p>&lt;p&gt;Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted Super King Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.&lt;/p&gt;<br />&lt;p&gt;&lt;strong&gt;400 Thread Count&lt;/strong&gt;&lt;/p&gt;<br />&lt;p&gt;With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat.&lt;/p&gt;<br />&lt;p&gt;&lt;strong&gt;Cosy Cream&lt;/strong&gt;&lt;/p&gt;<br />&lt;p&gt;Measuring 183 x 203 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, double and king size, as well as 46 cm deep variations.&lt;/p&gt;</p>'),(17,76,0,7,'<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>\r\n<p>Short Description</p>'),(18,85,0,7,'Cream Organic Cotton Fitted Sheet 400 TC, Super King'),(19,75,0,8,'<p>Our lavish, cream flat bed sheets are soft to the touch and made from pure organic cotton. Indulge yourself with smooth and silky, 400 thread count luxury bedding.</p>\r\n<p><strong>Soft Touch, High Quality</strong></p>\r\n<p>Made from gorgeously soft yet durable 100% organic cotton, our 400 thread count bed sheets are a fantastic choice for those with sensitive skin or allergies as it is machine washable, anti-dust mite and hypoallergenic. Thanks to the natural cotton fibres used, our bed linen stays cool in warm weather, provides cosiness in cold weather and gets even softer with every wash.</p>\r\n<p><strong>The Perfect Fit for Your Bed</strong></p>\r\n<p>These traditional flat sheets are perfect as a top sheet under a quilt or duvet, but are also a great option for extra deep mattresses that cannot fit under fitted sheets. Available in single, double, king size and super king size, you are sure to find a sheet that will cloak your mattress in luxury. This neutral cream design provides a beautifully warm, natural base for biscuit and coffee tones, or you could opt for a feminine theme with shell pink throws and cushions.</p>'),(21,85,0,8,'Cream Organic Cotton Flat Sheet 400 Thread count'),(22,75,0,9,'<p>Our lavish, cream single flat sheets are soft to the touch and made from pure organic cotton. Indulge yourself with smooth and silky, 400 thread count luxury bedding.</p>\r\n<p><strong>Soft Touch, High Quality</strong></p>\r\n<p>Made from gorgeously soft yet durable 100% organic cotton, our 400 thread count bed sheets are a fantastic choice for those with sensitive skin or allergies as it is machine washable, anti-dust mite and hypoallergenic. Thanks to the natural cotton fibres used, our bed linen stays cool in warm weather, provides cosiness in cold weather and gets even softer with every wash.</p>\r\n<p><strong>The Perfect Fit for Your Bed</strong></p>\r\n<p>These traditional flat sheets are perfect as a top sheet under a quilt or duvet, but are also a great option for extra deep mattresses that cannot fit under fitted sheets. This neutral cream design provides a beautifully warm, natural base for biscuit and coffee tones, or you could opt for a feminine theme with shell pink throws and cushions. Measuring approximately 178 x 255 cm, this single sheet will cloak your mattress in luxury. Also available in double, king size and super king size.</p>'),(24,85,0,9,'Cream Organic Cotton Flat Sheet 400 TC, Single'),(25,75,0,10,'<p>Our lavish, cream double flat sheets are soft to the touch and made from pure organic cotton. Indulge yourself with smooth and silky, 400 thread count luxury bedding.</p>\r\n<p><strong>Soft Touch, High Quality</strong></p>\r\n<p>Made from gorgeously soft yet durable 100% organic cotton, our 400 thread count bed sheets are a fantastic choice for those with sensitive skin or allergies as it is machine washable, anti-dust mite and hypoallergenic. Thanks to the natural cotton fibres used, our bed linen stays cool in warm weather, provides cosiness in cold weather and gets even softer with every wash.</p>\r\n<p><strong>The Perfect Fit for Your Bed</strong></p>\r\n<p>These traditional flat sheets are perfect as a top sheet under a quilt or duvet, but are also a great option for extra deep mattresses that cannot fit under fitted sheets. This neutral cream design provides a beautifully warm, natural base for biscuit and coffee tones, or you could opt for a feminine theme with shell pink throws and cushions. Measuring approximately 230 x 255 cm, this double sheet will cloak your mattress in luxury. Also available in single, king size and super king size.</p>'),(26,76,0,10,NULL),(27,85,0,10,'Cream Organic Cotton Flat Sheet 400 TC, Double'),(31,85,0,14,'Cotton Plain Green Ready Made Eyelet Curtain Pair'),(32,75,0,15,'<p>These trendy green curtains are the perfect interior accessory for your home this summer, as they are in a highly sought after shade of green. These curtains are sure to add a chic yet carefree feel to any room. These stylish Plain Cotton Green Eyelet Curtains are made up of a heavy cotton fabric that hangs wonderfully and would look charming in any room, regardless of whether the decor is contemporary or traditional. Coordinating ranges of cushions, floor cushions and fabric (to make your own soft furnishings) are available with Homescapes.</p>'),(33,85,0,15,'Cotton Plain Green Ready Made Eyelet Curtain Pair, 117 x 137 cm'),(34,75,0,16,'<p><span>These trendy green curtains are the perfect interior accessory for your home this summer, as they are in a highly sought after shade of green. These curtains are sure to add a chic yet carefree feel to any room. These stylish Plain Cotton Gree