hrows and cushions. Also available in small double, double, king and super king size, as well as 46 cm deep variations.</p>'),(82,75,0,35,'<p>Easy to use with a fully elasticated skirt, our Black 200 Thread Count Egyptian Cotton Fitted Single Sheet is perfect for making a dramatic impact in your bedroom.</p>\r\n<p><strong>100% Egyptian Cotton</strong></p>\r\n<p>Our 200 thread count, percale weave, Egyptian cotton fitted single sheet is 25 cm deep and will fit beds 90 cm wide and 190 cm long. The fully elasticated skirt means that your linen will be firmly secured all around your mattress, preventing awkward ruffling.</p>\r\n<p><strong>Easy to Wash</strong></p>\r\n<p>Ideal for those who suffer from sensitive skin, Homescapes cotton bedding sets are hypoallergenic so will not irritate your skin. They also exhibit anti-dust mite properties due to the dense percale weave so will improve dust mite allergy symptoms. Woven from 100% Egyptian cotton, they are machine washable and the durable, flexible fibres will get softer with every wash. This striking black sheet would look great in a glamorous, monochrome bedroom with luxurious throws and cushions. Also available in small double, double, king and super king size, as well as 46 cm deep variations.</p>'),(85,75,0,36,'<p>Easy to use with a fully elasticated skirt, our Black 200 Thread Count Egyptian Cotton Fitted Single Sheet is perfect for making a dramatic impact in your bedroom.</p>\r\n<p><strong>100% Egyptian Cotton</strong></p>\r\n<p>Our 200 thread count, percale weave, Egyptian cotton fitted single sheet is 25 cm deep and will fit beds 90 cm wide and 190 cm long. The fully elasticated skirt means that your linen will be firmly secured all around your mattress, preventing awkward ruffling.</p>\r\n<p><strong>Easy to Wash</strong></p>\r\n<p>Ideal for those who suffer from sensitive skin, Homescapes cotton bedding sets are hypoallergenic so will not irritate your skin. They also exhibit anti-dust mite properties due to t