  `has_options` smallint(6) NOT NULL DEFAULT '0' COMMENT 'has_options',
  `home_delivery_block` int(11) DEFAULT NULL COMMENT 'home_delivery_block column',
  `home_delivery_block_value` varchar(255) DEFAULT NULL COMMENT 'home_delivery_block column',
  `image` varchar(255) DEFAULT NULL COMMENT 'image',
  `image_label` varchar(255) DEFAULT NULL COMMENT 'image_label',
