INSERT INTO `catalog_product_flat_1` VALUES (1,9,'simple',NULL,'2018-03-29 11:00:05',34,'delivery','<p>Sink into our luxurious, hotel quality, Super Microfibre bounce back pillows. Inspired by natural down, this pair of ultra-soft, fluffy pillows is almost cloud-like.</p>\r\n<p><strong>Hotel Quality Pillows</strong></p>\r\n<p>Developed as a hypoallergenic alternative to natural down, Super Microfibre is incredibly soft and fluffy with springy, ‘bounce back’ qualities. An equally luxurious alternative to down cushions, our synthetic <a href=\"https://www.homescapesonline.com/bedding/pillows/microfibre-pillows.html\">Microfibre pillows</a> offer five-star hotel quality and are loved around the world.</p>\r\n<p><strong>100% Microfibre Bounce Back Pillows</strong></p>\r\n<p>These machine washable pillows have an anti-dust mite, 100% microfibre casing so are ideal for those who suffer from allergies, asthma and sensitive skin. With a gentle fill level, these fluffy pillows can be used on top of firmer pillows for back or side sleepers or by themselves for front sleepers. Prolong the life of your pillows with our range of <a href=\"https://www.homescapesonline.com/bedding/mattress-protectors-toppers/pillow-protectors.html\">pillow protectors</a>.</p>',1,2,0,36,'product-delivery-options','/m/a/main.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'Luxury Hotel Quality Super Microfibre Pillow Pair','2018-03-29 00:00:00',NULL,39.9900,NULL,NULL,0,0,NULL,23,'King','DP1162',NULL,'/m/a/main.jpg',NULL,'2018-03-29 00:00:00',19.9900,NULL,'/m/a/main.jpg',2,'/m/a/main.jpg',NULL,'2018-06-20 12:19:01','luxury-hotel-quality-super-microfibre-pillow-pair',NULL,4,2.0000,NULL),(3,9,'grouped',NULL,'2018-04-12 05:40:46',35,'delivery-tab-furniture-uk','<p>Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted King Size Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.</p>\r\n<p><strong>400 Thread Count</strong></p>\r\n<p>With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat.</p>\r\n<p><strong>Cosy Cream</strong></p>\r\n<p>Measuring 152 x 198 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, double and super king size, as well as 46 cm deep variations.</p>',1,2,0,36,'product-delivery-options','/_/n/_nd87842.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'Cream Organic Cotton Fitted Sheet 400 TC','2018-04-12 00:00:00',NULL,NULL,NULL,NULL,0,1,NULL,NULL,NULL,'BL1201',NULL,'/_/n/_nd87842.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'/_/n/_nd87842.jpg',NULL,'2018-07-18 11:00:29','cream-organic-cotton-fitted-sheet-400-tc',NULL,4,NULL,NULL),(4,9,'simple',NULL,'2018-04-12 05:45:32',34,'delivery',NULL,0,2,0,36,'product-delivery-options','/b/l/bl1201-main_1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'Cream Organic Cotton Fitted Sheet 400 TC, Single','2018-04-12 00:00:00',NULL,29.9900,NULL,NULL,0,0,NULL,25,'Single','BL1201A',NULL,'/b/l/bl1201-main_1.jpg',NULL,'2018-04-12 00:00:00',NULL,NULL,'/b/l/bl1201-main_1.jpg',2,'/b/l/bl1201-main_1.jpg',NULL,'2018-06-27 10:50:54','cream-organic-cotton-fitted-sheet-400-tc-single',NULL,3,1.0000,NULL),(5,9,'simple',NULL,'2018-04-12 05:47:22',34,'delivery','<p>Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted Double Sheet. The 25 cm deep, fu