fitted-sheet-double_4.jpg',2,'/0/2/02-400-tc-organic--deep-fitted-cream-fitted-sheet-double_4.jpg',NULL,'2018-06-27 10:50:34','cream-organic-cotton-fitted-sheet-400-tc-super-king',NULL,3,1.0000,NULL),(8,9,'grouped',NULL,'2018-04-12 06:08:22',35,'delivery-tab-furniture-uk','<p>Our lavish, cream flat bed sheets are soft to the touch and made from pure organic cotton. Indulge yourself with smooth and silky, 400 thread count luxury bedding.</p>\r\n<p><strong>Soft Touch, High Quality</strong></p>\r\n<p>Made from gorgeously soft yet durable 100% organic cotton, our 400 thread count bed sheets are a fantastic choice for those with sensitive skin or allergies as it is machine washable, anti-dust mite and hypoallergenic. Thanks to the natural cotton fibres used, our bed linen stays cool in warm weather, provides cosiness in cold weather and gets even softer with every wash.</p>\r\n<p><strong>The Perfect Fit for Your Bed</strong></p>\r\n<p>These traditional flat sheets are perfect as a top sheet under a quilt or duvet, but are also a great option for extra deep mattresses that cannot fit under fitted sheets. Available in single, double, king size and super king size, you are sure to find a sheet that will cloak your mattress in luxury. This neutral cream design provides a beautifully warm, natural base for biscuit and coffee tones, or you could opt for a feminine theme with shell pink throws and cushions.</p>',1,2,0,36,'product-delivery-options','/3/_/3_1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'Cream Organic Cotton Flat Sheet 400 Thread count','2018-04-12 00:00:00',NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,'BL1202',NULL,'/3/_/3_1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,'/3/_/3_1.jpg',NULL,'2018-06-15 07:58:29','cream-organic-cotton-flat-sheet-400-thread-count',NULL,4,NULL,NULL),(9,9,'simple',NULL,'2018-04-12 06:10:46',34,'delivery','<p>Our lavish, cream single flat sheets are soft to the touch and made from pure organic cotton. Indulge yourself with smooth and silky, 400 thread count lux