INSERT INTO `catalogsearch_fulltext_scope1` VALUES (1,73,'Luxury Hotel Quality Super Microfibre Pillow Pair'),(1,74,'DP1162'),(1,75,'Sink into our luxurious, hotel quality, Super Microfibre bounce back pillows. Inspired by natural down, this pair of ultra-soft, fluffy pillows is almost cloud-like. Hotel Quality Pillows Developed as a hypoallergenic alternative to natural down, Super Microfibre is incredibly soft and fluffy with springy, ‘bounce back’ qualities. An equally luxurious alternative to down cushions, our synthetic Microfibre pillows offer five-star hotel quality and are loved around the world. 100% Microfibre Bounce Back Pillows These machine washable pillows have an anti-dust mite, 100% microfibre casing so are ideal for those who suffer from allergies, asthma and sensitive skin. With a gentle fill level, these fluffy pillows can be used on top of firmer pillows for back or side sleepers or by themselves for front sleepers. Prolong the life of your pillows with our range of pillow protectors.'),(1,93,'Green'),(1,144,'48cm x 74cm (19\" x 29\")'),(1,152,'1000 TC'),(3,73,'Cream Organic Cotton Fitted Sheet 400 TC | Cream Organic Cotton Fitted Sheet 400 TC, Single | Cream Organic Cotton Fitted Sheet 400 TC, Double | Cream Organic Cotton Fitted Sheet 400 TC, King | Cream Organic Cotton Fitted Sheet 400 TC, Super King'),(3,74,'BL1201'),(3,75,'Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted King Size Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night. 400 Thread Count With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat. Cosy Cream Measuring 152 x 198 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, double and super king size, as well as 46 cm deep variations. | Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted Double Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night. 400 Thread Count With a 400 thread count weave, our fitted sheets are incredibly soft and light with a beautifully smooth finish. The cotton used in these sheets is 100% organic so you can have a great night’s sleep knowing that your bedding is as natural as possible. Ideal for those who have sensitive skin, the natural cotton anatomy ensures that this bed linen is breathable, hypoallergenic, anti-dust mite and incredibly good at maintaining temperature, allowing you to keep warm in cold weather and cool in the heat. Cosy Cream Measuring 137 x 190 cm, this double fitted sheet has a 25 cm deep skirt that is elasticated around the entire edge rather than just the corners to ensure a secure grip on your mattress. Combined with rich coffee coloured bedding, bright candy colours or even a navy and red nautical scheme, our versatile, neutral sheet will create a warm, enticing space to sleep in. Also available in single, king size and super king size, as well as 46 cm deep variations. | &lt;p&gt;Spoil yourself with our Cream 400 Thread Count Organic Cotton Fitted King Size Sheet. The 25 cm deep, fully elasticated fit will ensure a secure fit throughout the night.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;400 Thread Count&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;With a 400 thread count weave, our fitted 