a-angle-right\"></i></i>Door Knockers</a></li>\r\n\r\n						   </ul>\r\n\r\n						   <div class=\"col-md col-xs-12 laptop-visible\">\r\n							 <h3 class=\"title\">Featured product  </h3>\r\n							 <div class=\"fluid-width-video-wrapper\"><a href=\"{{store url=\'\'}}letter-delivery-boxes.html\"> <img class=\"img-fluid\" src=\"{{media url=\"wysiwyg/top-menu/smart-parcel-box.jpg\"}}\" alt=\"\"/></a>  </div>\r\n						   </div>\r\n\r\n\r\n						\r\n                   \r\n                 </div>\r\n				   \r\n				   \r\n               </div>\r\n             </div>\r\n           </li>\r\n\r\n		   <!--Easter-->\r\n\r\n           <li><a class=\"menu-special\" href=\"{{store url=\'\'}}homewares.html\">Easter  </a></li>\r\n\r\n			<!--customer assistance-->\r\n\r\n			<div class=\"extra-mobile-menu\">\r\n			   	<label for=\"customer\">Customer Assistance </label>\r\n				\r\n				 <ul class=\"menu-links\">\r\n					 <li><i class=\"fa fa-angle-right\"></i><a href=\"{{store url=\'\'}}delivery-information\">Delivery</a></li>\r\n					 <li><i class=\"fa fa-angle-right\"></i><a href=\"{{store url=\'\'}}information-about-returning-products\">Returns Information</a></li>\r\n					 <li><i class=\"fa fa-angle-right\"></i><a href=\"{{store url=\'\'}}track-your-order\">Order Tracking</a></li>\r\n					 <li><i class=\"fa fa-angle-right\"></i><a href=\"{{store url=\'\'}}faq\">Help & F. A. Qs</a></li>\r\n					 <li><i class=\"fa fa-angle-right\"></i><a href=\"{{store url=\'\'}}contacts\">Contact Us</a></li>\r\n				 </ul>\r\n			   \r\n			</div>\r\n\r\n         </ul>\r\n       </nav>\r\n       <!--Menu HTML Code-->\r\n		</div>\r\n	</div>\r\n     \r\n   </div>','2018-05-10 04:38:10','2018-05-10 04:38:10',1),(16,'Career Page','career-page','<p>Life @ Homescapes In the past, you could only find our products in top high-street shops or hotels, but now we’re offering you the chance to cut-out the middleman and buy from us direct. With no expensive department stores to pay for, we can offer you our products at a much lower price than most high-street retailers. And of course, we’re not limited by floor space, so can offer a far larger range.</p>\r\n\r\n<p>but now we’re offering you the chance to cut-out the middleman and buy from us direct. With no expensive department stores to pay for, we can offer you our products at a much lower price than most high-street retailers. And of course, we’re not limited by floor space, so can offer a far larger range.</p>','2018-05-23 09:15:57','2018-05-23 09:15:57',1),(17,'Delivery Tab Product Page - General','delivery','<table class=\"delivery-details table-striped\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p style=\"text-align: center;\"><strong>Delivery Option</strong></p>\r\n</td>\r\n<td>\r\n<p style=\"text-align: center;\"><strong>Cost</strong></p>\r\n</td>\r\n<td>\r\n<p style=\"text-align: center;\"><strong>Restriction</strong></p>\r\n</td>\r\n<td>\r\n<p style=\"text-align: center;\"><strong>Expected Delivery Time</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Standard UK Delivery</p>\r\n</td>\r\n<td>\r\n<p>FREE!</p>\r\n</td>\r\n<td>\r\n<p>Order value should be <strong>£49.99 or over</strong></p>\r\n</td>\r\n<td>\r\n<p>Orders placed before 7am will be dispatched the same day (Mon-Fri), excluding public holidays. Your order should arrive within <strong>1-3 working days.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Standard UK Delivery</p>\r\n</td>\r\n<td>\r\n<p><strong>£4.99</strong></p>\r\n</td>\r\n<td>\r\n<p>No Restriction</p>\r\n</td>\r\n<td>\r\n<p>Orders placed before 7am will be dispatched the same day (Mon-Fri), excluding public holidays. Your order should arrive within <strong>1-3 working days.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Express UK Delivery</p>\r\n</td>\r\n<td>\r\n<p><strong>£6.99</strong></p>\r\n</td>\r\n<td>\r\n<p>Order before 3pm (Mon-Fri), excluding public holidays</p>\r\n</td>\r\n<td>\r\n<p>Orders will be dispatched the same day (Mon-Fri). Your order should arrive within 1-2 working days.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><img src=\"{{skin url=\'images/collectplus-logo.png\'}}\" alt=\"\" /></p>\r\n</td>\r\n<td>\r\n<p><strong>From £3.99</strong></p>\r\n</td>\r\n<td>\r\n<p>Not available outside the UK and on the heavy furniture items. <a href=\"{{config path=\"web/unsecure/base_url\"}}delivery-information#FreeCollect\">Find out more</a></p>\r\n</td>\r\n<td>\r\n<p>Order online and collect it from your chosen collectPlus store. Orders placed before 7am will be available to <strong>collect from 12pm (mid-day) the next working day.</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>International Delivery</p>\r\n</td>\r\n<td>\r\n<p><a href=\"{{config path=\"web/unsecure/base_url\"}}delivery-information#InternationalDeliveries\">click here</a> for international delivery charges</p>\r\n</td>\r\n<td>\r\n<p>No Restriction</p>\r\n</td>\r\n<td>\r\n<p>Your order should arrive within <strong>7-10 working days</strong> from dispatch.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>* Service terms and delivery times may be amended during peak periods or sales. Please see our <a href=\"{{config path=\"web/unsecure/base_url\"}}delivery-information\">shipping &amp; delivery information page</a> or contact our customer support available at 0121 3680051 (9am-5pm, Monday to Friday)</p>','2018-05-25 11:42:30','2018-05-25 11:42:30',1),(18,'Returns Tab Product Page','returns','<p>Homescapes is committed to selling quality products that you’ll love, but we understand that sometimes things quite simply aren’t suitable. If something’s not right, contact us at <a href=\"mailto:support@homescapesonline.com\">support@homescapesonline.com</a>.</p>\r\n<p>Please note that if you do wish to return your purchase, it must be returned to us unused, unwashed and in its original packaging within 30 days of receipt.</p>\r\n<p>For detailed information on our returns and refunds policy, <a href=\"{{config path=\"web/unsecure/base_url\"}}information-about-returning-products\"><span style=\"text-decoration: underline;\">click here</span></a>.</p>','2018-05-25 11:43:12','2018-05-25 11:43:12',1),(19,'Order Swatch Success','swatch_sucess','<p>We hope that these swathes help you when making the right decision for your home, if you do require any further product details or wish to talk to us in more detail, please do not hesitate to contact us at support@homescapesonline.com or call us Monday - Friday, (9am – 5pm BST) on 0121 368 0051.</p>','2018-05-29 04:46:54','2018-05-29 04:46:54',1),(20,'product sizing','product-sizing','<div class=\"container product-sizing\">\r\n<div class=\"row\">\r\n<div class=\"col-md\"><a><i class=\"fas fa-book\"></i> Buying Guide</a> <a><i class=\"far fa-list-alt\"></i> Size Guide</a> <a><i class=\"fas fa-play-circle\"></i> See in Action</a></div>\r\n</div>\r\n</div>','2018-05-29 11:14:52','2018-05-29 11:14:52',1),(21,'Delivery Tab Furniture Page UK','delivery-tab-furniture-uk','<p>Furniture deliveries start from as little as &pound;4.99. The precise delivery charge for your order will depend on the items you have chosen and the area for delivery. Most orders will be delivered within &pound;29.99 delivery charge. Regardless of your order size you will only be charged one delivery fee which is dependent on the largest item ordered.</p>\r\n<p>Orders for in stock items will be dispatched within 10 working days of placing your order for most locations. Homescapes will contact you prior to your delivery to arrange a mutually convenient date and time frame. You will be contacted on the day of delivery detailing a more accurate delivery time.</p>\r\n<p>Please click here for furniture costs and information</p>\r\n<p>Unfortunately, we are currently unable to ship furniture, bulky or fragile items to the following areas:</p>\r\n<address><strong>The Highlands and Islands of Scotland:</strong> Postcodes IV, HS, KW, ZE, KA27-28, PA20-49, PA60-78, PH17-44, PH49-50<br /> <strong>Northern Ireland/Eire:</strong> Postcodes BT<br /> <strong>Isle of Man:</strong> Postcodes IM<br /> <strong>Isles of Scilly:</strong> Postcodes TR21-TR25<br /> <strong>Channel Islands:</strong> JE, GY</address>','2018-05-30 12:56:15','2018-05-30 12:56:15',1),(22,'Product Installation','product_installation','<div class=\"container product-instalment\">\r\n<div class=\"row\">\r\n<div class=\"col-md\"><img src=\"{{media url=\"wysiwyg/Home/finance.png\"}}\" alt=\"\" /></div>\r\n</div>\r\n</div>','2018-06-01 06:37:30','2018-06-01 06:37:30',1),(23,'Product Videos','product-videos','<iframe src=\"https://www.youtube.com/embed/2p3qI7ngMuY?rel=0&amp;controls=0&amp;showinfo=0\" width=\"100%\" height=\"325\" frameborder=\"0\" allowfullscreen=\"\"></iframe>','2018-06-15 09:41:02','2018-06-15 09:41:02',1);
