INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-right','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2018-03-29 10:04:47','2018-03-29 10:04:47',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home page','1column','','','home','','<p>{{block class=\"Magento\\\\Cms\\\\Block\\\\Block\" block_id=\"Slider\"}}{{block class=\"Magento\\\\Cms\\\\Block\\\\Block\" block_id=\"designer-bed-Linen\"}}</p>\r\n\r\n\r\n\r\n','2018-03-29 10:04:47','2018-03-29 10:04:47',1,0,'<!--\r\n    <referenceContainer name=\"right\">\r\n        <referenceBlock name=\"catalog.compare.sidebar\" remove=\"true\" />\r\n    </referenceContainer>-->','','',NULL,NULL,NULL,''),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2018-03-29 10:04:47','2018-03-29 10:04:47',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy and Cookie Policy','1column','','','info/website-privacy-and-cookies','Website Privacy and Cookies','<div class=\"container cmspage\">\r\n		\r\n		<div class=\"row\">\r\n			\r\n			<p>We at Homescapes are committed to protecting your privacy and take extensive measures to make sure that our customers’ information is kept secure and private. \r\nOn this page we explain how we use customer information and the ways in which we comply with the Data Protection Act 1998 to protect customer privacy.\r\nOur Privacy Policy has been updated to consider the way we process European data and how we disclose your personal and non-personal data. This is in accordance with the new General Data Protection Regulation (May 2018).</p>\r\n	\r\n			<div id=\"accordion\" role=\"tablist\">\r\n\r\n			  <div class=\"card\" id=\"one\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingOne\">\r\n					\r\n					<a data-toggle=\"collapse\"  href=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n					  <h5>\r\n						  Information we collect about you & how we use it\r\n\r\n					  </h5>\r\n					 </a> \r\n				</div>\r\n\r\n				<div id=\"collapseOne\" class=\"collapse show\" role=\"tabpanel\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<p>When you make a purchase, we need to collect certain information about you to process your order. These details may include but are not limited to your name, address, email, delivery address and other contact details such as your telephone number. <br>\r\n\r\nWhen you buy online from us your payment details are taken and collected by our on-line payment provider and these are not available to us.  As a result, we do not store or hold any financial details about you when you purchase from us on our website. <br>\r\n\r\nWe do keep a record of your personal order details, this includes your contact details and order details this is so that we can deal with any queries and problems that may arise with an order in future, retaining these records allows us to deal with anything in a timely manner.<br>\r\n<br>\r\n\r\n\r\nWhen you contact us via email or call our customer helpdesk we may also store contact details and correspondence from you, this is to further enhance our ability to give our customers the best service possible. We may also contact you with offers and promotions that we think may be of interest to you. If you do not wish to receive these offers, please contact our customer care team. Please be assured that we do not share any of your details with third parties for marketing purposes.<br>\r\n\r\nWhen you sign up to receive our newsletter, you are consenting to receive marketing communications from Homescapes. You are agreeing to receive order information and promotional updates via email, postal mail or SMS/MMS messages. Homescapes never share any of your personal date with third parties. You can opt out of any marketing communication by simply clicking unsubscribe at the bottom of any email communication or contact us for help.</p>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n\r\n			  <div class=\"card\" id=\"two\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingTwo\">\r\n				  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n					<h5>\r\n					\r\n					  How long will we keep your personal data?\r\n					\r\n				  	</h5>\r\n				  </a>\r\n				</div>\r\n				<div id=\"collapseTwo\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<p>Whenever we collect your personal data we do so for mandatory reasons and we will only store it for as long as is necessary and for the purpose that it was collected. At the end of this retention period your data will be deleted completely or anonymised. By anonymising your data it means that your information will no longer be identifiable to you in any way, this may be used for statistical analysis and business planning. </p>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n\r\n			  <div class=\"card\" id=\"three\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingThree\">\r\n				  	 <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n						<h5>\r\n\r\n						  Protection of Personal Information\r\n\r\n					  </h5>\r\n					 </a>\r\n				</div>\r\n				<div id=\"collapseThree\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<p>All your personal information is safe and secure with us; we use the best encryption techniques and the pinnacle of secure software to make sure that all customer data is kept private and not intercepted by third parties. <br>\r\n\r\nWe have strict security procedures in place to protect and safeguard all data and information that we store from any unauthorized access, as required under UK Data Protection Legislation.  We will never share you data with third parties that are outside of Homescapes. </p>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n\r\n			  <div class=\"card\" id=\"four\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingFour\">\r\n				  	<a data-toggle=\"collapse\" class=\"collapsed\" href=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseFour\">	\r\n						<h5>\r\n						  Changing or Deletion of data\r\n\r\n					  </h5>\r\n					</a>\r\n				</div>\r\n				<div id=\"collapseFour\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<p>As a registered user you can update, review and correct the personal data on your account details page. You can also contact us at: support@homescapesonline.com should you need to update your contact email address.<br>\r\n\r\nHomescapes will delete personal data upon request, unless mandatory obligations contradict such a decision. You can unsubscribe from our email newsletter and mailing list by clicking on the unsubscribe button found at the bottom of all of our emails. You can also contact us at: support@homescapesonline.com.<br>\r\n\r\nBy not subscribing or unsubscribing your data you will not be penalised and it will have absolutely no detrimental effects.</p>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n				\r\n			  <div class=\"card\" id=\"Five\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingFive\">\r\n				  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\r\n					<h5>\r\n					\r\n					  Cookies Policy & Managing Cookies\r\n					\r\n				    </h5>\r\n				  </a>\r\n				</div>\r\n				<div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<p>For technical reasons and to ensure you are receiving the best possible service from Homescapes we use several cookies on our website.<br>\r\n<br>\r\n\r\n\r\nWe use cookies for a number of reasons; one of them is to allow you to access features on the site in the best possible manner. As an example we use cookies to give you the ability to use our shopping cart system, so you can buy our products online. <br>\r\n\r\nWe also use cookies as a way of analysing customer behaviour and habits, to improve on the features and the usability of the website based on the information we gain through the use of tracking software. <br>\r\n<br>\r\n\r\n\r\nPlease note that cookies can’t harm your computer. Homescapes do not store any personally identifiable information such as credit card details in the cookies that we create, but we do use encrypted information gathered from them to help improve your overall experience of the site. For examples we use cookies to help us identify and resolve any site errors or to determine relevant products to show you whilst browsing.<br>\r\n\r\nIf you wish to disable the use of cookies on our website then you should be able to turn them off on your browser software by disabling the feature. If cookies are disabled you may experience some restricted usage with some of the features of our website. You can also follow this link: http://www.allaboutcookies.org/manage-cookies which will show you how to manage cookies and keep your information up to date.<br>\r\n<br>\r\n\r\n\r\nAt present no industry-wide uniform standard has been agreed and adopted to determine how DNT requests should be managed, Homescapes website does not currently respond to DNT requests. Until that standard is established, we will continue to review DNT and new technologies, but won’t respond to DNT requests. Homescapes have relationships with selected, established companies who may also set cookies during your visit to our site. </p>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n				\r\n			  <div class=\"card\" id=\"Six\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingSix\">\r\n				  \r\n					<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseSix\" aria-expanded=\"false\" aria-controls=\"collapseSix\">\r\n						<h5>\r\n\r\n						 Third party cookies\r\n\r\n					  </h5>\r\n						\r\n					</a>\r\n				</div>\r\n				<div id=\"collapseSix\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSix\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					<table class=\"table table table-bordered\">\r\n					<tbody>\r\n					<tr>\r\n					<td><strong>Google Analytics</strong></td>\r\n					<td>Homescapes use Google Analytics, this tells us about the way people use homescapesonline.com. Google Analytics uses cookies to detect if someone has been on the website before, this also gives us information about how often you return and the length of your stay. Homescapes use this to ensure you are having a good experience on the site and to improve it where possible.<br /> Google Analytics sets cookies to estimate the number of people visiting Homescapes and shows how they are moving around, this data is used to create the best site structure and suite content. <br /> For more information, please visit Google: <a href=\"https://www.google.com/intl/en_ALL/policies/privacy/\" rel=\"nofollow\">https://www.google.com/intl/en_ALL/policies/privacy/</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Google AdWords</strong></td>\r\n					<td>Homescapes use Google AdWords remarketing to advertise on Google search and third party websites (for previous visitors to our site). This advertising may be visible to customers as well as users who have visited our site previously, filled in information or who have enquired about something. <br /> The advertisements may be in the form or an advert on a Google Search page or on a website within the Google Display Network. Any data collected will be used in accordance with Homescapes and Google&rsquo;s privacy policy.<br /> You can set your Google advertisement preferences here: <a href=\"https://adssettings.google.com/authenticated?hl=en\" rel=\"nofollow\">https://adssettings.google.com/authenticated?hl=en</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Facebook Conversion Tracking Pixel</strong></td>\r\n					<td>This pixel is used when you click on a Facebook advertisement, allowing us to redirect you though our website determined by the click you made. The cookie allows us to monitor and improve the efficiency of our Facebook advertising. The data collected is anonymous (we cannot see any personal data from an individual Facebook user).<br /> This data is processed by Facebook and at this moment in time, Facebook can use this information for their own advertising purposes, this is in accordance with Facebook&rsquo;s Data Use Policy found here: <a href=\"https://www.facebook.com/about/privacy/\" rel=\"nofollow\">https://www.facebook.com/about/privacy/</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Twitter Conversion Tracking Pixel</strong></td>\r\n					<td>This pixel is used when you click on a Twitter advertisement, allowing us to redirect you through our website depending on the click you made. The cookie allows us to monitor and improve the efficiency of our Twitter advertising. The data we collect is anonymous (we cannot see any personal data from an individual Facebook user).<br /> This data is processed by Twitter and at this moment in time, Twitter can use this information for their own advertising purposes, this is in accordance with their Data Use Policy<br /> Twitter&rsquo;s Privacy policy can be found here: <a href=\"https://help.twitter.com/en/safety-and-security#ads-and-data-privacy\" rel=\"nofollow\">https://help.twitter.com/en/safety-and-security#ads-and-data-privacy</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>SalesManago</strong></td>\r\n					<td>We use SalesManago to personalise our contact with you this cookie allows us to retrieve shopping baskets and provide you with personalised email offers. <br /> You can find SalesManago information here:<br /> <a href=\"https://salesmanago.com/marketing-automation/contactform.htm\" rel=\"nofollow\">https://salesmanago.com/marketing-automation/contactform.htm</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Active Campaign</strong></td>\r\n					<td>We use Active Campaign to personalise our contact with you this cookie allows us to retrieve shopping baskets and provide you with personalised email offers.<br /> The Active Campaign privacy policy can be found here:<br /> <a href=\"https://www.activecampaign.com/gdpr-updates/\" rel=\"nofollow\">https://www.activecampaign.com/gdpr-updates/</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Affiliate Window - 6284</strong></td>\r\n					<td>This is used by AWIN (Affiliate Window) when you purchase from us through another website. <br /> If you wish to opt out please visit: <a href=\"http://www.networkadvertising.org/choices/\" rel=\"nofollow\">http://www.networkadvertising.org/choices/</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Facebook</strong></td>\r\n					<td>We use Facebook social plugins on our site to allow users to like Homescapes or share a product or post. Facebook will access cookies if you have been on Facebook previously. <br /> For more information please visit Facebook: <a href=\"https://www.facebook.com/about/privacy/\" rel=\"nofollow\">https://www.facebook.com/about/privacy/</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Twitter</strong></td>\r\n					<td>We use Titter social plugins on our site, this allows users to easily share content via Twitter and to display the latest Tweets from Homescapes.<br /> For more information please visit Twitter: <a href=\"https://twitter.com/privacy\" rel=\"nofollow\">https://twitter.com/privacy</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong>Google+</strong></td>\r\n					<td>We use Google+ plugins on our site, this allows viewers to share links through this platform. The plugin will access cookies, these will vary depending on whether you are logged in to Google at the time. <br /> For more information please visit Google: <a href=\"http://www.google.com/intl/en_uk/+/policy/+1button.html\" rel=\"nofollow\">http://www.google.com/intl/en_uk/+/policy/+1button.html</a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong> Instagram</strong></td>\r\n					<td>We use the Instagram social plugins on our site to allow users to follow Homescapes or view our Instagram feed. Instagram will access cookies if you have been on Instagram previously.<br /> For more information please visit Instagram: <a href=\"http://www.google.com/intl/en_uk/+/policy/+1button.html\" rel=\"nofollow\">https://help.instagram.com/155833707900388 </a></td>\r\n					</tr>\r\n					<tr>\r\n					<td><strong> Pinterest </strong></td>\r\n					<td>We use the Pinterest plugin on our site to allow users to pin products onto their boards. The plugin will access cookies, these will vary depending on whether you are logged in to Pinterest at the time. <br /> For more information please visit Pinterest: <a href=\"https://policy.pinterest.com/en-gb/privacy-policy\" rel=\"nofollow\">https://policy.pinterest.com/en-gb/privacy-policy</a></td>\r\n					</tr>\r\n					</tbody>\r\n					</table>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n				\r\n			  <div class=\"card\" id=\"Seven\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingSeven\">\r\n				  \r\n					<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseSeven\" aria-expanded=\"false\" aria-controls=\"collapseSeven\">\r\n						<h5>\r\n\r\n						 Cookies we collect \r\n\r\n					  </h5>\r\n						\r\n					</a>\r\n				</div>\r\n				<div id=\"collapseSeven\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSeven\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					  \r\n					<strong>The table below lists the cookies we collect:</strong><br><br>\r\n\r\n\r\n					<table class=\"table-bordered table\">\r\n					<thead>\r\n					<tr><th>COOKIE name</th><th>COOKIE Description</th></tr>\r\n					</thead>\r\n					<tbody>\r\n					<tr><th>CART</th>\r\n					<td>The association with your shopping cart.</td>\r\n					</tr>\r\n					<tr><th>CATEGORY_INFO</th>\r\n					<td>Stores the category info on the page, that allows to display pages more quickly.</td>\r\n					</tr>\r\n					<tr><th>COMPARE</th>\r\n					<td>The items that you have in the Compare Products list.</td>\r\n					</tr>\r\n					<tr><th>CURRENCY</th>\r\n					<td>Your preferred currency</td>\r\n					</tr>\r\n					<tr><th>CUSTOMER</th>\r\n					<td>An encrypted version of your customer id with the store.</td>\r\n					</tr>\r\n					<tr><th>CUSTOMER_AUTH</th>\r\n					<td>An indicator if you are currently logged into the store.</td>\r\n					</tr>\r\n					<tr><th>CUSTOMER_INFO</th>\r\n					<td>An encrypted version of the customer group you belong to.</td>\r\n					</tr>\r\n					<tr><th>CUSTOMER_SEGMENT_IDS</th>\r\n					<td>Stores the Customer Segment ID</td>\r\n					</tr>\r\n					<tr><th>EXTERNAL_NO_CACHE</th>\r\n					<td>A flag, which indicates whether caching is disabled or not.</td>\r\n					</tr>\r\n					<tr><th>FRONTEND</th>\r\n					<td>You sesssion ID on the server.</td>\r\n					</tr>\r\n					<tr><th>GUEST-VIEW</th>\r\n					<td>Allows guests to edit their orders.</td>\r\n					</tr>\r\n					<tr><th>LAST_CATEGORY</th>\r\n					<td>The last category you visited.</td>\r\n					</tr>\r\n					<tr><th>LAST_PRODUCT</th>\r\n					<td>The most recent product you have viewed.</td>\r\n					</tr>\r\n					<tr><th>NEWMESSAGE</th>\r\n					<td>Indicates whether a new message has been received.</td>\r\n					</tr>\r\n					<tr><th>NO_CACHE</th>\r\n					<td>Indicates whether it is allowed to use cache.</td>\r\n					</tr>\r\n					<tr><th>PERSISTENT_SHOPPING_CART</th>\r\n					<td>A link to information about your cart and viewing history if you have asked the site.</td>\r\n					</tr>\r\n					<tr><th>POLL</th>\r\n					<td>The ID of any polls you have recently voted in.</td>\r\n					</tr>\r\n					<tr><th>POLLN</th>\r\n					<td>Information on what polls you have voted on.</td>\r\n					</tr>\r\n					<tr><th>RECENTLYCOMPARED</th>\r\n					<td>The items that you have recently compared.</td>\r\n					</tr>\r\n					<tr><th>STF</th>\r\n					<td>Information on products you have emailed to friends.</td>\r\n					</tr>\r\n					<tr><th>STORE</th>\r\n					<td>The store view or language you have selected.</td>\r\n					</tr>\r\n					<tr><th>USER_ALLOWED_SAVE_COOKIE</th>\r\n					<td>Indicates whether a customer allowed to use cookies.</td>\r\n					</tr>\r\n					<tr><th>VIEWED_PRODUCT_IDS</th>\r\n					<td>The products that you have recently viewed.</td>\r\n					</tr>\r\n					<tr><th>WISHLIST</th>\r\n					<td>An encrypted list of products added to your Wishlist.</td>\r\n					</tr>\r\n					<tr><th>WISHLIST_CNT</th>\r\n					<td>The number of items in your Wishlist.</td>\r\n					</tr>\r\n					</tbody>\r\n					</table>\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n				\r\n			  <div class=\"card\" id=\"Eight\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingEight\">\r\n				  \r\n					<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseEight\" aria-expanded=\"false\" aria-controls=\"collapseEight\">\r\n						<h5>\r\n\r\n						 Further information about cookies \r\n\r\n					  </h5>\r\n						\r\n					</a>\r\n				</div>\r\n				<div id=\"collapseEight\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingEight\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					  \r\n					To learn more about cookies and how to manage them, please visit: <a href=\"https://www.aboutcookies.org/how-to-control-cookies/\">https://www.aboutcookies.org/how-to-control-cookies/</a>\r\n\r\n\r\n					\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n				\r\n			  <div class=\"card\" id=\"Nine\">\r\n				<div class=\"card-header \" role=\"tab\" id=\"headingNine\">\r\n				  \r\n					<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseNine\" aria-expanded=\"false\" aria-controls=\"collapseNine\">\r\n						<h5>\r\n\r\n						 Banner advertising on other websites\r\n\r\n					  </h5>\r\n						\r\n					</a>\r\n				</div>\r\n				<div id=\"collapseNine\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingNine\" data-parent=\"#accordion\">\r\n				  <div class=\"card-body\">\r\n					  \r\n					Banner advertising works by showing you a selection of products based on what you have been viewing on homescapesonline.com. These are presented to you when you visited selected third party websites. The adverts will show you a range of alternative products that are relevant to your browsing cookies. These adverts use cookies to work.<br>\r\n<br>\r\n\r\nWe want to make sure that the adverts you see are relevant and of interest to you, however, you can choose to disable and opt out of this type of advertising permanently by visiting: <a href=\"http://www.networkadvertising.org/choices/\">http://www.networkadvertising.org/choices/</a>\r\nPlease note, if you also choose to delete your cookies, we will no longer know that you have opted out, so the display banners will reappear when you visit other websites.\r\n\r\n\r\n					\r\n				  </div>\r\n				</div>\r\n			  </div>\r\n\r\n			</div>  \r\n			\r\n		</div>\r\n	  \r\n	</div>','2018-03-29 10:04:47','2018-03-29 10:04:47',1,0,'','','',NULL,NULL,NULL,''),(5,'Delivery Iinformation','1column','','','delivery-information','','<div class=\"container cms-pages\">\r\n		 \r\n		 <div class=\"row row justify-content-md-center\">\r\n			 <div class=\"col-md-12 col-lg-9 text-center\">\r\n				 <h1>Delivery Information</h1>\r\n				 <p>See below for information about the delivery & returns options in your country</p>\r\n			 </div>\r\n		 </div>\r\n		 \r\n		 <!--Top Menu-->\r\n		 \r\n		 <div class=\"row justify-content-md-center\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 col-lg-offset-2 top-menu text-center\">\r\n			 \r\n				 <ul>\r\n					 <li><a href=\"{{store direct_url=\"information-about-returning-products\"}}\" ><i class=\"fas fa-exchange-alt\"></i> Returns </a></li>\r\n					 <li><a href=\"{{store direct_url=\"delivery-information\"}}\" class=\"active\"> <i class=\"fas fa-truck\"></i> Delivery</a></li>\r\n					 <li><a href=\"{{store direct_url=\"track-your-order\"}}\" ><i class=\"fas fa-map-marker-alt\"></i> Order Tracking </a></li>\r\n				 </ul>\r\n			 \r\n			 </div>\r\n		 </div>\r\n		 \r\n		 <!--Open Accordian-->\r\n		 \r\n		 <div id=\"accordion\" role=\"tablist\">\r\n		 \r\n		 <div class=\"row justify-content-md-center content\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 open-cmspage\">\r\n				 \r\n					  <!--Free Standard Delivery-->\r\n\r\n					  <div class=\"card\" id=\"one1\">\r\n						  \r\n						<div class=\"card-header \" role=\"tab\" id=\"headingOne1\">\r\n\r\n							<a data-toggle=\"collapse\" class=\"collapsed\" href=\"#collapseOne1\" aria-expanded=\"false\" aria-controls=\"collapseOne1\">\r\n							  <h5>\r\n								  <span class=\"del-icons free-d\">Free Delivery</span>\r\n								  <span class=\"title\">Free Standard Delivery</span> <p class=\"pricing\"><strong>Free</strong><br>Orders of £49.99 and over </p>\r\n\r\n							  </h5>\r\n							 </a> \r\n						</div>\r\n\r\n						<div id=\"collapseOne1\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne1\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							<ul class=\"list\">\r\n								 <li>FREE standard delivery for orders of £49.99 and over*(Not appliacable on Furniture, Cilck & Collect orders)</li>\r\n							 </ul>\r\n							  \r\n						  </div>\r\n						</div>\r\n						  \r\n					  </div>\r\n				 \r\n					  <!--Standard UK Delivery-->	\r\n				 \r\n					  <div class=\"card\" id=\"two2\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingTwo2\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseTwo2\" aria-expanded=\"false\" aria-controls=\"collapseTwo2\">\r\n							<h5>\r\n\r\n							 <span class=\"del-icons standard-uk-d\">Standard UK Delivery</span>\r\n							 <span class=\"title\">Standard UK Delivery</span> \r\n							 <p class=\"pricing\"><strong>£4.99</strong><br>For orders under £49.99 </p>\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						<div id=\"collapseTwo2\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo2\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							 <ul class=\"list\">\r\n								 <li>Orders placed before 7am will be dispatched the same day (Mon-Fri), excluding public holidays</li>\r\n								 <li>Orders will be sent using a tracked courier service</li>\r\n								 <li>Please note that Standard Delivery is not available on fragile or large furniture items</li>\r\n								 <li>Your order should arrive within 1-3 working days.</li>\r\n							 </ul>\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n					 \r\n				 	  <!--Express UK Delivery-->\r\n					 \r\n					  <div class=\"card\" id=\"Three3\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingThree3\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseThree3\" aria-expanded=\"false\" aria-controls=\"collapseThree3\">\r\n							<h5>\r\n\r\n							 <span class=\"del-icons express-uk-d\">Express UK Delivery</span>\r\n							 <span class=\"title\">Express UK Delivery</span> \r\n							 <p class=\"pricing\"><strong>£6.99</strong><br>Order before 3pm Mon-Fri</p>\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						<div id=\"collapseThree3\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree3\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							 <ul class=\"list\">\r\n								 <li>Order before 3pm Monday-Friday (excluding public holidays) to receive your order within 1-2 working days</li>\r\n								 <li>Orders placed after 3pm on Friday will be dispatched on Monday to arrive by Wednesday</li>\r\n								 <li>Orders will be sent using a tracked courier service</li>\r\n								 <li>Please note that Express Delivery is not available on fragile or large furniture items</li>\r\n\r\n\r\n							 </ul>\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  <!--Click & Collect-->\r\n				  \r\n				 	  <div class=\"card\" id=\"Four4\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingFour4\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFour4\" aria-expanded=\"false\" aria-controls=\"collapseFour4\">\r\n							<h5>\r\n\r\n							 <span class=\"del-icons click-d\">Click & Collect</span>\r\n							 <span class=\"title\">Click & Collect</span> \r\n							 <p class=\"pricing\"><strong>£3.99 / £6.99</strong><br>Standard / Express</p>\r\n							\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						  \r\n						<div id=\"collapseFour4\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour4\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n							\r\n				 			<span>Order online and collect it from your chosen convenient local store</span>\r\n							 <ul class=\"list\">\r\n								 <li>Orders placed before 7am Monday-Friday will be delivered next day, you will receive notification from CollectPlus when your parcel is available to collect.</li>\r\n								 <li>Click & Collect is available on orders with dimensions of 60 x 50 x 50cm or less, with a maximum weight of 10kg</li>\r\n							 </ul>\r\n							  \r\n							  \r\n							 <strong><a href=\"{{store direct_url=\"faq?t=collectplus\"}}\">CollectPlus FAQs</a></strong>\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  <!--Personalised Embroidered Service-->\r\n				  \r\n				 	  <div class=\"card\" id=\"Five5\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingFive5\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFive5\" aria-expanded=\"false\" aria-controls=\"collapseFive5\">\r\n							<h5>\r\n\r\n							 <span class=\"del-icons personalised-d\">Personalised Embroidered Service</span>\r\n							 <span class=\"title\">Personalised Embroidered Service</span> \r\n							 <p class=\"pricing\"><strong>£4.99</strong><br>For orders under £49.99</p>\r\n							\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						  \r\n						<div id=\"collapseFive5\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive5\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n							\r\n				 			<span>All UK orders that include personalisation or embroidery will take between 5 to 7 days to arrive, they will be dispatched on our standard, tracked delivery service. You will be notified when your order has been dispatched</span>\r\n							  \r\n							 <ul class=\"list\">\r\n								 <li> For orders under £49.99 a standard £4.99 delivery fee will be charged. Orders of £49.99 or over will receive FREE delivery</li>\r\n								 <li>International order delivery fees can be found below. Once dispatched, international deliveries should arrive within 7-10 working days.</li>\r\n							 </ul>\r\n							  \r\n							  \r\n							\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  <!--Made to Measure-->\r\n				  \r\n				 	  <div class=\"card\" id=\"Six6\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingSix6\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseSix6\" aria-expanded=\"false\" aria-controls=\"collapseSix6\">\r\n							<h5>\r\n\r\n							 <span class=\"del-icons measure-d\">Made to Measure</span>\r\n							 <span class=\"title\">Made to Measure </span> \r\n							 <p class=\"pricing\"><strong>Free</strong></p>\r\n							\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						  \r\n						<div id=\"collapseSix6\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSix6\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n							\r\n				 			<span>For orders placed using our made to measure service estimated delivery time is 10-15 days. Homescapes will keep in regular contact with you about your order via email and notify you when your order has been dispatched.</span>\r\n							  \r\n							 <ul class=\"list\">\r\n								 <li> FREE standard delivery on all Made to measure orders.</li>\r\n								 <li> Once dispatched, your order should arrive within 1-3 working days.</li>\r\n								 <li> Orders will be sent using a tracked courier service.</li>\r\n								 <li> International order delivery fees can be found below. Once dispatched, international deliveries should arrive within 7-10 working days.</li>\r\n\r\n							 </ul>\r\n							  \r\n							  \r\n							 \r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n\r\n\r\n				 \r\n				 \r\n			 </div>\r\n		 </div>\r\n		 \r\n\r\n		 \r\n		 \r\n		 <!-- Desktop Accordian Starts here-->\r\n		 \r\n		 <div class=\"row justify-content-md-center mobile-pad content\">\r\n			 \r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 cmspage\">\r\n			 \r\n				 \r\n					 \r\n				  <!--Furniture & Large/Fragile Items-->\r\n\r\n				  <div class=\"card\" id=\"one\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingOne\">\r\n\r\n						<a data-toggle=\"collapse\" class=\"collapsed\"  href=\"#collapseOne\" aria-expanded=\"false\" aria-controls=\"collapseOne\">\r\n						  <h5>\r\n							  <span class=\"close-del-icons furniture-d\">Furniture</span> Furniture & Large/Fragile Items\r\n\r\n						  </h5>\r\n						 </a> \r\n					</div>\r\n\r\n					<div id=\"collapseOne\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						  \r\n						  \r\n						<p class=\"head\">Furniture Delivery Information</p>\r\n						  \r\n						<ul>\r\n							\r\n							<li>Depending on our delivery schedule, you can expect to receive your item within 15 working days. Please contact us for more information.</li>\r\n							<li>Prior to the delivery, we shall contact you to arrange a mutually convenient delivery time (Monday-Sunday).</li>\r\n							<li>On the day of delivery, our driver will call you 30-45 minutes prior to the delivery. On arrival, they will unpack the item and inspect it to confirm that it has arrived safely with no damage.</li>\r\n							<li>Please note that our drivers are only insured to deliver to ground level, our drivers are not able to carry any furniture upstairs.</li>\r\n							<li>We do not take away any packaging and cannot offer a package disposal service. We advise you to keep the package encase of return or if you wish to transport the furniture at a later date.</li>\r\n							<li>Unfortunately, we are currently unable to ship furniture, bulky or fragile items to the following areas:<br>\r\n\r\n							\r\n								<span class=\"f\">\r\n									The Highlands and Islands of Scotland: Postcodes IV, HS, KW, ZE, KA27-28, PA20-49, PA60-78, PH17-44, PH49-50<br>\r\n\r\n									Northern Ireland/Eire: Postcodes BT<br>\r\n\r\n									Isle of Man: Postcodes IM<br>\r\n\r\n									Isles of Scilly: Postcodes TR21-TR25<br>\r\n\r\n									Channel Islands: JE, GY\r\n								</span>\r\n							\r\n							</li>\r\n						  \r\n						</ul> \r\n						<br>\r\n\r\n						<p class=\"head\">Furniture Delivery Prices</p>\r\n\r\n						<p>Delivery prices are dependent on product size and customer location. For large quantity orders a standard delivery rate of £39.99 will be applied (surcharge is applicable for outlying postcodes).</p>\r\n						  \r\n						  \r\n						<table class=\"table\">\r\n							<tbody>\r\n							\r\n								<tr>\r\n								\r\n									<td>Small</td>\r\n									<td>Nest of tables, bar stools</td>\r\n									<td>£4.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Medium</td>\r\n									<td>Mirrors, small tables, bedside tables</td>\r\n									<td>£9.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Large</td>\r\n									<td>Coffee tables, TV units, small sideboards, small bookcases</td>\r\n									<td>£19.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Extra Large</td>\r\n									<td>Tall bookcases, large sideboards, beds, dining tables</td>\r\n									<td>£29.99</td>\r\n								\r\n								</tr>\r\n								\r\n							</tbody>  \r\n						</table>\r\n						  \r\n						  \r\n					    <p class=\"head\">Applicable surcharge for outlying postcodes: DD, FK8-21, KY, PH1-14</p>\r\n						  \r\n						  \r\n						<table class=\"table\">\r\n							<tbody>\r\n							\r\n								<tr>\r\n								\r\n									<td>Small</td>\r\n									<td>£3.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Medium</td>\r\n									<td>£5.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Large</td>\r\n									<td>£10.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Extra Large</td>\r\n									<td>£15.00</td>\r\n								\r\n								</tr>\r\n								\r\n							</tbody>  \r\n						</table>\r\n						  \r\n						<p class=\"head\">Applicable surcharge for outlying postcodes: PH15-16, PH45-48, AB</p>\r\n						  \r\n						  \r\n						<table class=\"table\">\r\n							<tbody>\r\n							\r\n								<tr>\r\n								\r\n									<td>Small</td>\r\n									<td>£5.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Medium</td>\r\n									<td>£10.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Large</td>\r\n									<td>£15.00</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Extra Large</td>\r\n									<td>£20.00</td>\r\n								\r\n								</tr>\r\n								\r\n							</tbody>  \r\n						</table>\r\n						  \r\n					  </div>\r\n					</div>\r\n				  </div>\r\n					 \r\n				  <!--International Delivery-->\r\n\r\n				  <div class=\"card\" id=\"two\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingTwo\">\r\n					  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n						<h5>\r\n\r\n						 <span class=\"close-del-icons international-d\">International</span> International Delivery\r\n\r\n						</h5>\r\n					  </a>\r\n					</div>\r\n					<div id=\"collapseTwo\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						\r\n						  \r\n						  <ul>\r\n						  \r\n						  	<li>International delivery is available to various locations within Europe</li>\r\n						  	<li>Orders placed before 7am will be dispatched the same day (Mon-Fri), excluding public holidays</li>\r\n						  	<li>You should receive your order within 3-10 working days from dispatch depending on your delivery destination.</li>\r\n						  	<li>\r\n								\r\n								The number of days to deliver are approximately as follows:\r\n								\r\n								<ul>\r\n								\r\n									<li>3-5 Working Days: Austria, Belgium, France, Germany, Netherlands and Switzerland</li>\r\n									<li>5- 7 Working Days: Denmark, Italy, Portugal and Spain</li>\r\n									<li>7+ Working Days: All other destinations.</li>\r\n									\r\n								\r\n								</ul>\r\n							  \r\n							  \r\n							</li>\r\n							<li>\r\n    						International delivery is available on orders with dimensions of 90 x 60 x 30cm or less, with a maximum weight of 30kg. Please note for larger orders, we may ask for an additional delivery charge\r\n    \r\n							</li>\r\n							<li>Delivery charges are calculated depending on the location. If your location is not listed below, please <a href=\"{{store direct_url=\"contacts\"}}\">contact us</a> for a delivery quote</li>  \r\n							  \r\n						  </ul>\r\n						  \r\n						  <table class=\"table\">\r\n							<tbody>\r\n							\r\n								<tr>\r\n								\r\n									<td>Country</td>\r\n									<td>Delivery Charges</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Netherlands, Belgium</td>\r\n									<td>£7.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Austria, France, Germany, Ireland (ROI), Luxembourg, Slovenia</td>\r\n									<td>£9.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n								\r\n									<td>Denmark, Poland, Spain, Slovakia</td>\r\n									<td>£11.99</td>\r\n								\r\n								</tr>\r\n								\r\n								<tr>\r\n									<td>Italy, Liechtenstein</td>\r\n									<td>£12.99</td>\r\n								</tr>\r\n								\r\n								<tr>\r\n									<td>Hungary, Portugal, Sweden, Lithuania</td>\r\n									<td>£14.99</td>\r\n								</tr>\r\n								\r\n								<tr>\r\n									<td>Finland, Latvia, Estonia, Switzerland</td>\r\n									<td> 	£19.99</td>\r\n								</tr>\r\n								\r\n								<tr>\r\n									<td>Croatia</td>\r\n									<td> 	£50.00</td>\r\n								</tr>\r\n								\r\n							</tbody>  \r\n						</table>\r\n						  \r\n					  </div>\r\n						\r\n					</div>\r\n				  </div>\r\n					 \r\n					 \r\n				  <!--Extra delivery information-->\r\n					 \r\n\r\n				  <div class=\"card\" id=\"three\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingThree\">\r\n						 <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseThree\" aria-expanded=\"false\" aria-controls=\"collapseThree\">\r\n							<h5>\r\n\r\n							  <span class=\"close-del-icons extra-d\">Extra</span> Extra Delivery Information\r\n\r\n						  </h5>\r\n						 </a>\r\n					</div>\r\n					<div id=\"collapseThree\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						\r\n						  <p class=\"head\">Public and Bank Holidays</p>\r\n\r\n							<p>We are unable to dispatch or deliver orders during public and bank holidays.</p>\r\n\r\n						  <p class=\"head\">		Sale & Peak Periods </p>\r\n\r\n							<p>Service terms and delivery times may be amended during peak periods or sales.</p>\r\n						  \r\n						  <p class=\"head\">Deliveries that Require a Signature</p>\r\n\r\n<p>In most cases, a signature is required on receipt of delivery. If there is no one to sign for the goods, an attempt is usually made to deliver the parcel to a neighbour.<br>\r\n<br>\r\n\r\n\r\nIf your order cannot be left with a neighbour, delivery will be re-attempted the next working day. If delivery is still not possible, the goods will be held at a depot for up to fourteen days (depending on the courier). If this is the case, the courier will leave a card explaining how to collect your parcel. If you do not collect your order within the allotted time period, it will be returned to us. In the case of this happening the postage will not be refunded.</p>\r\n						  \r\n						  \r\n					  </div>\r\n					</div>\r\n				  </div>\r\n					 \r\n				  <!--Missing Orders-->\r\n\r\n				  <div class=\"card\" id=\"four\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingFour\">\r\n						<a data-toggle=\"collapse\" class=\"collapsed\" href=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseFour\">	\r\n							<h5>\r\n							  <span class=\"close-del-icons missing-d\">Missing</span> Missing Orders\r\n\r\n						  </h5>\r\n						</a>\r\n					</div>\r\n					<div id=\"collapseFour\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						<p>If you have not received your order after 4 working days, you should contact us as soon as possible so that we can query the status of your delivery with the courier. We will not be able to process any claims of non-receipt of deliveries after two weeks after the original shipping date, as we lose the right to claim against the loss with most couriers.</p>\r\n					  </div>\r\n					</div>\r\n				  </div>\r\n					 \r\n				  <!--out of stock-->\r\n\r\n				  <div class=\"card\" id=\"Five\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingFive\">\r\n					  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\r\n						<h5>\r\n\r\n						 <span class=\"close-del-icons out-d\">Out</span> Out of Stock Items\r\n\r\n						</h5>\r\n					  </a>\r\n					</div>\r\n					<div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						<p>\r\n\r\n						In the unlikely occurrence of a product being out of stock, we shall inform you as soon as possible by contacting you by telephone or email. From there, we can work out the best solution for you. </p>\r\n					  </div>\r\n					</div>\r\n				  </div>\r\n					 \r\n				  <!--Customer Services-->\r\n\r\n				  <div class=\"card\" id=\"Six\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingSix\">\r\n\r\n						<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseSix\" aria-expanded=\"false\" aria-controls=\"collapseSix\">\r\n							<h5>\r\n\r\n							 <span class=\"close-del-icons customer-d\">Customer</span> Customer Services\r\n\r\n						  </h5>\r\n\r\n						</a>\r\n					</div>\r\n					<div id=\"collapseSix\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSix\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n						<p>If you require any more information regarding our delivery times and prices, please contact our customer support. You can contact us by <a href=\"\">email</a> or give us a call on 0121 3680051 (9am-5pm, Monday to Friday). </p>\r\n					  </div>\r\n					</div>\r\n				  </div>\r\n\r\n				  <!-- <div class=\"card\" id=\"Seven\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingSeven\">\r\n\r\n						<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseSeven\" aria-expanded=\"false\" aria-controls=\"collapseSeven\">\r\n							<h5>\r\n\r\n							 Cookies we collect \r\n\r\n						  </h5>\r\n\r\n						</a>\r\n					</div>\r\n					<div id=\"collapseSeven\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSeven\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n\r\n						<strong>The table below lists the cookies we collect:</strong><br><br>\r\n\r\n\r\n						<table class=\"table-bordered table\">\r\n						<thead>\r\n						<tr><th>COOKIE name</th><th>COOKIE Description</th></tr>\r\n						</thead>\r\n						<tbody>\r\n						<tr><th>CART</th>\r\n						<td>The association with your shopping cart.</td>\r\n						</tr>\r\n						<tr><th>CATEGORY_INFO</th>\r\n						<td>Stores the category info on the page, that allows to display pages more quickly.</td>\r\n						</tr>\r\n						<tr><th>COMPARE</th>\r\n						<td>The items that you have in the Compare Products list.</td>\r\n						</tr>\r\n						<tr><th>CURRENCY</th>\r\n						<td>Your preferred currency</td>\r\n						</tr>\r\n						<tr><th>CUSTOMER</th>\r\n						<td>An encrypted version of your customer id with the store.</td>\r\n						</tr>\r\n						<tr><th>CUSTOMER_AUTH</th>\r\n						<td>An indicator if you are currently logged into the store.</td>\r\n						</tr>\r\n						<tr><th>CUSTOMER_INFO</th>\r\n						<td>An encrypted version of the customer group you belong to.</td>\r\n						</tr>\r\n						<tr><th>CUSTOMER_SEGMENT_IDS</th>\r\n						<td>Stores the Customer Segment ID</td>\r\n						</tr>\r\n						<tr><th>EXTERNAL_NO_CACHE</th>\r\n						<td>A flag, which indicates whether caching is disabled or not.</td>\r\n						</tr>\r\n						<tr><th>FRONTEND</th>\r\n						<td>You sesssion ID on the server.</td>\r\n						</tr>\r\n						<tr><th>GUEST-VIEW</th>\r\n						<td>Allows guests to edit their orders.</td>\r\n						</tr>\r\n						<tr><th>LAST_CATEGORY</th>\r\n						<td>The last category you visited.</td>\r\n						</tr>\r\n						<tr><th>LAST_PRODUCT</th>\r\n						<td>The most recent product you have viewed.</td>\r\n						</tr>\r\n						<tr><th>NEWMESSAGE</th>\r\n						<td>Indicates whether a new message has been received.</td>\r\n						</tr>\r\n						<tr><th>NO_CACHE</th>\r\n						<td>Indicates whether it is allowed to use cache.</td>\r\n						</tr>\r\n						<tr><th>PERSISTENT_SHOPPING_CART</th>\r\n						<td>A link to information about your cart and viewing history if you have asked the site.</td>\r\n						</tr>\r\n						<tr><th>POLL</th>\r\n						<td>The ID of any polls you have recently voted in.</td>\r\n						</tr>\r\n						<tr><th>POLLN</th>\r\n						<td>Information on what polls you have voted on.</td>\r\n						</tr>\r\n						<tr><th>RECENTLYCOMPARED</th>\r\n						<td>The items that you have recently compared.</td>\r\n						</tr>\r\n						<tr><th>STF</th>\r\n						<td>Information on products you have emailed to friends.</td>\r\n						</tr>\r\n						<tr><th>STORE</th>\r\n						<td>The store view or language you have selected.</td>\r\n						</tr>\r\n						<tr><th>USER_ALLOWED_SAVE_COOKIE</th>\r\n						<td>Indicates whether a customer allowed to use cookies.</td>\r\n						</tr>\r\n						<tr><th>VIEWED_PRODUCT_IDS</th>\r\n						<td>The products that you have recently viewed.</td>\r\n						</tr>\r\n						<tr><th>WISHLIST</th>\r\n						<td>An encrypted list of products added to your Wishlist.</td>\r\n						</tr>\r\n						<tr><th>WISHLIST_CNT</th>\r\n						<td>The number of items in your Wishlist.</td>\r\n						</tr>\r\n						</tbody>\r\n						</table>\r\n					  </div>\r\n					</div>\r\n				  </div>\r\n\r\n				  <div class=\"card\" id=\"Eight\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingEight\">\r\n\r\n						<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseEight\" aria-expanded=\"false\" aria-controls=\"collapseEight\">\r\n							<h5>\r\n\r\n							 Further information about cookies \r\n\r\n						  </h5>\r\n\r\n						</a>\r\n					</div>\r\n					<div id=\"collapseEight\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingEight\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n\r\n						To learn more about cookies and how to manage them, please visit: <a href=\"https://www.aboutcookies.org/how-to-control-cookies/\">https://www.aboutcookies.org/how-to-control-cookies/</a>\r\n\r\n\r\n\r\n					  </div>\r\n					</div>\r\n				  </div>\r\n\r\n				  <div class=\"card\" id=\"Nine\">\r\n					<div class=\"card-header \" role=\"tab\" id=\"headingNine\">\r\n\r\n						<a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseNine\" aria-expanded=\"false\" aria-controls=\"collapseNine\">\r\n							<h5>\r\n\r\n							 Banner advertising on other websites\r\n\r\n						  </h5>\r\n\r\n						</a>\r\n					</div>\r\n					<div id=\"collapseNine\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingNine\" data-parent=\"#accordion\">\r\n					  <div class=\"card-body\">\r\n\r\n						Banner advertising works by showing you a selection of products based on what you have been viewing on homescapesonline.com. These are presented to you when you visited selected third party websites. The adverts will show you a range of alternative products that are relevant to your browsing cookies. These adverts use cookies to work.<br>\r\n	<br>\r\n\r\n	We want to make sure that the adverts you see are relevant and of interest to you, however, you can choose to disable and opt out of this type of advertising permanently by visiting: <a href=\"http://www.networkadvertising.org/choices/\">http://www.networkadvertising.org/choices/</a>\r\n	Please note, if you also choose to delete your cookies, we will no longer know that you have opted out, so the display banners will reappear when you visit other websites.\r\n\r\n\r\n\r\n					  </div>\r\n					</div>\r\n				  </div>-->\r\n\r\n				</div>\r\n			 \r\n\r\n			 \r\n		 </div>\r\n		 \r\n	  	 </div>\r\n\r\n	</div>','2018-05-11 03:36:07','2018-06-15 05:15:07',1,0,'','','',NULL,NULL,NULL,''),(6,'Return Information','1column','','','information-about-returning-products','','<div class=\"container cms-pages\">\r\n		 \r\n		 <div class=\"row row justify-content-md-center\">\r\n			 <div class=\"col-md-12 col-lg-9 text-center\">\r\n				 <h1>Product Return Policy</h1>\r\n				 <p><strong>Homescapes offers a very simple, customer friendly 30 days returns policy.</strong> If you wish to return an item for an exchange or refund all we ask is that the product is returned to us within 30 days of receipt in an unwashed, unused condition and in its original packaging.\r\n\r\nIt is the customer’s responsibility to cover the cost of any returns and to ensure returned items are sent back correctly. Homescapes will only cover the costs if your item is faulty. </p>\r\n			 </div>\r\n		 </div>\r\n		 \r\n		 <!--Top Menu-->\r\n		 \r\n		 <div class=\"row justify-content-md-center\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 col-lg-offset-2 top-menu text-center\">\r\n			 \r\n				 <ul>\r\n					 <li><a href=\"{{store direct_url=\"delivery-information\"}}\"> <i class=\"fas fa-truck\"></i> Delivery</a></li>\r\n					 <li><a href=\"{{store direct_url=\"information-about-returning-products\"}}\" class=\"active\"><i class=\"fas fa-exchange-alt\"></i> Returns </a></li>\r\n					 <li><a href=\"{{store direct_url=\"track-your-order\"}}\" ><i class=\"fas fa-map-marker-alt\"></i> Order Tracking </a></li>\r\n				 </ul>\r\n			 \r\n			 </div>\r\n		 </div>\r\n		 \r\n		 <!--Open Accordian-->\r\n		 \r\n		 <div id=\"accordion\" role=\"tablist\">\r\n		 \r\n		 <div class=\"row justify-content-md-center content\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 open-cmspage\">\r\n				 \r\n					  <!--Authorization-->\r\n\r\n					  <div class=\"card\" id=\"one1\">\r\n						  \r\n						<div class=\"card-header \" role=\"tab\" id=\"headingOne1\">\r\n\r\n							<a data-toggle=\"collapse\" class=\"collapsed\" href=\"#collapseOne1\" aria-expanded=\"false\" aria-controls=\"collapseOne1\">\r\n							  <h5>\r\n								  <i class=\"fas fa-truck\"></i> \r\n								  <span class=\"title\">Step 1. Returns Authorisation</span> \r\n								  \r\n								  <p class=\"pricing\">\r\n									  \r\n									  <strong>Download</strong>\r\n									  \r\n									  <br>\r\n									  \r\n									  <a href=\"\"><i class=\"fas fa-download\"></i> Authorisation Form </a> \r\n								  </p>\r\n\r\n							  </h5>\r\n							 </a> \r\n						</div>\r\n\r\n						<div id=\"collapseOne1\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne1\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							<ul class=\"list\">\r\n								 <li>You must fill in and enclose a Returns Authorisation Form with your returned items. Your refund or exchange cannot be processed without one.</li>\r\n								<li>If your item is faulty, please write to support@homescapesonline.com detailing the issue.</li>\r\n								\r\n								<li> You may also contact customer care on 0121 368 0051 to discuss the issue in more detail.</li>\r\n							 </ul>\r\n							  \r\n						  </div>\r\n						</div>\r\n						  \r\n					  </div>\r\n				 \r\n					  <!--Return Method-->	\r\n				 \r\n					  <div class=\"card\" id=\"two2\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingTwo2\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseTwo2\" aria-expanded=\"false\" aria-controls=\"collapseTwo2\">\r\n							<h5>\r\n\r\n							 <i class=\"fas fa-truck\"></i> \r\n							 <span class=\"title\">Step 2. Packaging</span> \r\n							 <p class=\"pricing\"><strong>Original Packaging</strong> </p>\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						<div id=\"collapseTwo2\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo2\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							 <ul class=\"list\">\r\n								 <li>A returned item must be packaged in its original packaging.  </li>\r\n								 <li>If this is not possible please ensure it is packaged well so that it arrives back to Homescapes safely and securely.</li>\r\n								 <li>Please ensure that inadequately packed items may get damaged in transit and such returns will not be accepted.</li>\r\n							 </ul>\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n					 \r\n				 	  <!--Step 3. collection-->\r\n					 \r\n					  <div class=\"card\" id=\"Three3\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingThree3\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseThree3\" aria-expanded=\"false\" aria-controls=\"collapseThree3\">\r\n							<h5>\r\n\r\n							 <i class=\"fas fa-truck\"></i> \r\n							 <span class=\"title\">Step 3. Return Methods</span> \r\n							 <p class=\"pricing\"><strong>£7.49 / £4.00</strong><br>\r\n								 \r\n								 <a href=\"\"><i class=\"fas fa-download\"></i>Collection form</a> <br>\r\n\r\n								 <a href=\"\"><i class=\"fas fa-print\"></i>Print a label</a> \r\n								\r\n								</p>\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						<div id=\"collapseThree3\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree3\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n\r\n							 <ul class=\"list\">\r\n								 \r\n								 <span>There are several ways in which you can return an item to us.  If you opt for a service that requires a customer payment, this will be deducted from your total refund.</span>\r\n								 \r\n								 <li><strong>A. Return arranged by customer</strong> - \r\n\r\nCustomer returns the items to Homescapes by the carrier of their choice.</li>\r\n								 <li>B. Homescapes arranged courier collection - £7.49 - \r\n\r\nHomescapes will book a collection to be picked up from your address. The collection can be arranged from your home, work or any other address on day of your choice (Saturdays, Sundays and bank holidays not included). You will need to download this collection form and email to Homescapes customer care to arrange the collection.</li>\r\n								 \r\n								 <li><strong><strong>C. CollectPlus collection</strong> - £4.00</strong> -\r\n\r\nCustomer takes the properly packed item to a shop of their choice for returning the item. Please note that there are size and weight restrictions. <strong><a href=\"{{store direct_url=\"faq?t=collectplus\"}}\">CollectPlus FAQs</a></strong>\r\n								 </li>\r\n								<br>\r\n\r\n\r\n								 \r\n								 <span>Homescapes will only take responsibility of a return when it reaches our returns warehouse. If you have organised a return and the parcel is damaged or goes missing in transit, because you have organised this service, it is your responsibility to raise a claim or contact the courier about the whereabouts of your parcel.  </span>\r\n		\r\n							 </ul>\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  <!--Step 4. Exchange or Refund-->\r\n				  \r\n				 	  <div class=\"card\" id=\"Four4\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingFour4\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFour4\" aria-expanded=\"false\" aria-controls=\"collapseFour4\">\r\n							<h5>\r\n\r\n							 <i class=\"fas fa-truck\"></i> \r\n							 <span class=\"title\">Step 4. Exchange or Refund</span> \r\n							 <p class=\"pricing\"><strong>3-5 working days</strong></p>\r\n							\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						  \r\n						<div id=\"collapseFour4\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour4\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n							\r\n				 			<span>Order online and collect it from your chosen convenient local store</span>\r\n							 <ul class=\"list\">\r\n								 <li>Once we have received your return it will be processed in our warehouse.  </li>\r\n								 \r\n								 <li>If you have requested an exchange your replacement or alternative item will be dispatched within 2-3 days of receiving your order.  </li>\r\n								 \r\n								 <li>If you have returned the item because you have changed your mind and wish to receive a refund, this will be processed within 3-5 days of receiving your return. </li>\r\n								 \r\n								 <li> Please note that a refund can take a further 3-5 working days to appear in your bank account.</li>\r\n							 </ul>\r\n							  \r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  <!--Furniture Orders-->\r\n				  \r\n				 	  <div class=\"card\" id=\"Five5\">\r\n						<div class=\"card-header \" role=\"tab\" id=\"headingFive5\">\r\n						  <a class=\"collapsed\" data-toggle=\"collapse\" href=\"#collapseFive5\" aria-expanded=\"false\" aria-controls=\"collapseFive5\">\r\n							<h5>\r\n\r\n							 <i class=\"fas fa-truck\"></i> \r\n							 <span class=\"title\">Furniture Orders</span> \r\n							 <p class=\"pricing\"><strong>£50.00</strong><br>Collection and Restocking fee</p>\r\n							\r\n\r\n							</h5>\r\n						  </a>\r\n						</div>\r\n						  \r\n						<div id=\"collapseFive5\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive5\" data-parent=\"#accordion\">\r\n						  <div class=\"card-body\">\r\n							\r\n				 		\r\n							  \r\n							 <ul class=\"list\">\r\n								 <li> We deliver all large and bulky furniture orders using our own fleet of delivery vans.  </li>\r\n								 \r\n								 <li>If you have changed your mind about a furniture order and it has already been delivered to you, please contact Customer Care to arrange a collection, we charge a £50.00 collection and restocking fee on all furniture collections. </li>\r\n								 \r\n								 <li>In the unlikely chance that your furniture is faulty, please contact Customer Care to discuss this in more detail.</li>\r\n							 </ul>\r\n							  \r\n							  \r\n							\r\n\r\n						  </div>\r\n\r\n						</div>\r\n					  </div>\r\n				 \r\n				 	  \r\n				  \r\n				 	  \r\n\r\n\r\n				 \r\n				 \r\n			 </div>\r\n		 </div>\r\n		  \r\n		 \r\n	  	 </div>\r\n\r\n	</div>','2018-05-11 11:40:33','2018-05-11 11:40:33',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(7,'Track your order','1column','','','track-your-order','','<div class=\"container cms-pages\">\r\n		 \r\n		 <div class=\"row row justify-content-md-center\">\r\n			 <div class=\"col-md-12 col-lg-9 text-center\">\r\n				 <h1>Track Your Order</h1>\r\n				 <p>You should have received an email from Homescapes with the shipment tracking number upon the dispatch of your order. <br>\r\nPlease use it to track your order. </p>\r\n			 </div>\r\n		 </div>\r\n		 \r\n		 <!--Top Menu-->\r\n		 \r\n		 <div class=\"row justify-content-md-center\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9 col-lg-offset-2 top-menu text-center\">\r\n			 \r\n				 <ul>\r\n					 <li><a href=\"{{store direct_url=\"delivery-information\"}}\"> <i class=\"fas fa-truck\"></i> Delivery</a></li>\r\n					 <li><a href=\"{{store direct_url=\"track-your-order\"}}\" class=\"active\" ><i class=\"fas fa-map-marker-alt\"></i> Order Tracking </a></li>\r\n					 <li><a href=\"{{store direct_url=\"information-about-returning-products\"}}\" ><i class=\"fas fa-exchange-alt\"></i> Returns </a></li>\r\n				 </ul>\r\n			 \r\n			 </div>\r\n		 </div>\r\n\r\n		 <div class=\"row justify-content-md-center content\">\r\n			 \r\n			 <div class=\"col-md-12 col-lg-9  text-center\">\r\n\r\n				<div id=\"as-root\">&nbsp;</div>\r\n				<script type=\"text/javascript\">// <![CDATA[\r\n				(function(e,t,n){var r,i=e.getElementsByTagName(t)[0];if(e.getElementById(n))return;\r\n				r=e.createElement(t);r.id=n;r.src=\"//button.aftership.com/all.js\";i.parentNode.insertBefore(r,i)})(document,\"script\",\"aftership-jssdk\")\r\n				// ]]></script>\r\n				<div class=\"as-track-button\" data-size=\"large\" data-domain=\"homescapes.aftership.com\">&nbsp;</div>\r\n				<p><strong>Furniture Deliveries</strong></p>\r\n				<p>Please note the bulky items like furniture are not delivered by courier network and cannot be tracked here. <br>\r\nPlease contact our customer support for help regarding your furniture orders.</p>\r\n				<p><strong>CollectPlus Order Tracking</strong></p>\r\n				<p>For tracking collectPlus order please click on below link</p>\r\n				<p><a href=\"https://www.collectplus.co.uk/track\">https://www.collectplus.co.uk/track</a></p>\r\n				<p><strong>Need Help?</strong></p>\r\n				<p>We\'re here Monday-Friday 9:00 AM - 5:00 PM</p>\r\n				<p>Call us at: 0121 3680051</p>\r\n				<p>Email - <a href=\"mailto:support@homescapesonline.com\">support@homescapesonline.com</a></p>\r\n				 \r\n			 </div>\r\n		 </div>\r\n		  \r\n\r\n	</div>','2018-05-14 07:39:16','2018-05-14 07:39:16',1,0,'','','',NULL,NULL,NULL,''),(8,'Register','1column','','','register','','<p>{{block class=\"Magento\\Newsletter\\Block\\Subscribe\" template=\"Homescapes_Newsletters::addform.phtml\"}}</p>','2018-05-30 12:54:31','2018-05-30 12:54:31',1,0,'','','',NULL,NULL,NULL,'');
