INSERT INTO `review_detail` VALUES (1,1,1,'linens plus','I have used Homescapes many times over the past 10 yrs or more and the quality of service is fantastic. The items I have bought have all proved to be of good quality especially considering the price point.',' Dave S',NULL,'',1),(2,2,1,'first class product','first class product. Excellent quality and colour is perfect.','Sandra Mcgonigle	',NULL,NULL,1),(3,3,1,'Lovely','Fits the mattress lovely. Very pleased.','Renee Kim Hyne',NULL,NULL,1),(4,4,1,'Think clotted cream ......','As one reviewer stated more yellow than cream hence think clotted cream. Not disappointed though. Lovely quality, good price and washes well. Would recommend especially if you are just looking for plain bed linen.',' Paula',NULL,NULL,1),(5,5,1,'let down by the colour','Excellent quality, but disappointed with the colour they are supposed to be cream but they are more yellow than cream','Pru',NULL,'',1),(6,6,1,'let down by the colour','Excellent quality, but disappointed with the colour they are supposed to be cream but they are more yellow than cream','Pru',NULL,'',1),(7,7,1,'Luxurious','These feel so soft against your skin , won\'t want anything else from now on','Fred',NULL,NULL,1),(8,8,1,'Excellent','One of the best companies I have ordered from . Excellent !','Fred',NULL,NULL,1),(9,9,1,'Excellent Quality','Lovely quality flannelette sheet set.\r\nprompt delivery.\r\nExcellent service\r\nOrdering another set whilst the sale is on...Thank you','Monica Tomkinson',NULL,NULL,1),(10,10,1,'Lovely','Fits the mattress lovely. Very pleased.','Renee Kim Hyne',NULL,NULL,1),(11,11,1,'Fabulous','Ordered the dark grey knitted pouffe and when it arrived the quality was great. As good as any other high street store one - at a much cheaper cost of £39.99. Delivered when promised too.',' Jane Porter',NULL,NULL,1),(12,12,1,'Good','Its a good pillow, given the price and reviews I think that maybe I had too high expectations. Homescapes sells a cheaper set of two pillows which are just as comfortable or better.','Andrea',NULL,NULL,1),(13,13,1,'curtains & cushions','Very fast delivery and accurate description. Good quality cotton and washable (some curtains are dry clean only) - they look great in my sons room to complement his Minecraft theme','Ann',NULL,NULL,1),(15,15,1,'let down by the colour','Excellent quality, but disappointed with the colour they are supposed to be cream but they are more yellow than cream','Pru',NULL,'',1),(17,17,1,'Test','Test','Test',NULL,'ssp32.bleuciel@gmail.com',1),(18,18,1,'Luxury hotel quality super microfibres pillow pair','I have been buying these for years as they are the only ones I have found that really suit me. I agree with one of the reviewers that the latest ones seem higher than the previous ones I bought. I also agree that they go lumpy over time but I use two pillows and currently have the new one on the bottom and use the lumpy one on top as I can mould it to support my neck comfortably',' Mrs Valerie Flux	',NULL,'rajeevmc@homescapesonline.com',0),(20,20,1,'Milan','I m the designer ','Manoj',NULL,'rajeev@homescapesonline.com',0);
/*!40000 ALTER TABLE `review_detail` ENABLE KEYS */;
UNLOCK TABLES;

